Alice Babs (born Hildur Alice Nilsson in January 26, 1924) is a singer and actor from Kalmar in Sweden. While she has worked in a wide number of genres, she is best known internationally as a jazz singer. Making her breakthrough in Swing it magistern (Swing It, Teacher!) (1940), she appeared in more than a dozen Swedish language-films. Despite playing the well-behaved, good-hearted, cheerful girl, the youth culture forming with Alice Babs as its icon caused outrage among members of the older generation. A vicar called the Alice Babs cult the &quot;foot and mouth disease to cultural life&quot;.





